import React from "react";
import NavBar from "./NavBar";
import "./Main.css";
const Main=(props)=>{
    return(
     <div>
        <div style={{width:"100%"}}>
        <NavBar account={props.account}/>
        </div>
        <div className="d-flex align-item-center justify-content-center">
        <div className="main">
        <table>
            <th>Staking Balance</th>
            <th>Reward Balance</th>
        </table>
        </div>
        </div>
     </div>
    );
}
export default Main;
